/*
API:

Data:
    JSON-like diccionary with all header-value
Header:
    MUST HAVE:
        {
            title: str,
            field: str,
            visible: boolean,
            filter: { str[key]: 'text' },
            modify: boolean
        }
        - title: The name of the header to show.
        - field: The name of the key in the data.
        - visible: true/false for show or not.
        - filter: The key in the data that filter this header, and 'text' for filter by text.
        - modify: true/false if can be modified or not (usefull for ID or Primary-keys)

GET /data :-
    PARAM QUERY :-
        count: int
        page: int
        sorting: [str]=asc|desc
    RETURN :-
        { 
            result  : [Data],
            columns : [Headers],
            total   : int
        }
    Example petition:
        Without parse:
            GET /data?count=100&page=1&sorting[name]asc    
        With parse:
            GET /data?count=100&page=1&sorting%5Bname%5Dasc

    Example return:
        [{"Password": "5I&c%7%bAn", "City": "Burgos", "First name": "Manuel", "Job": "Garment/textile technologist", "Last Name": "Granados", "Company": "Ibarra-Jove", "ID": 129, "Credit Card": "5464204951237040"}, 
         {"Password": "gxoXKwg7nk", "City": "\u00c1vila", "First name": "Ra\u00fal", "Job": "Occupational hygienist", "Last Name": "Tolosa", "Company": "Camino, Maza and Santos", "ID": 27, "Credit Card": "5477861036171450"}]


PUT /data :-
    DATA CONTENT :-
        An object like the one you gived as a string (a row data).
    RETURN :-
        None

    Example:
        PUT /data
        Content: {"Password": "5I&c%7%bAn", "City": "Burgos", "First name": "Manuel", "Job": "Garment/textile technologist", "Last Name": "Granados", "Company": "Ibarra-Jove", "ID": 129, "Credit Card": "5464204951237040"}


# Yeah, I know, I'm using POST for delete, because this API is not a full REST API, is just a mock!
POST /data :-
    DATA CONTENT :-
        An array object like the one you gived as a string (an array of data).
    RETURN :-
        None

    Example:
        POST /data
        Content: [{"Password": "5I&c%7%bAn", "City": "Burgos", "First name": "Manuel", "Job": "Garment/textile technologist", "Last Name": "Granados", "Company": "Ibarra-Jove", "ID": 129, "Credit Card": "5464204951237040"}]
*/

function isNumber(n) {
    return !isNaN(parseFloat(n)) && isFinite(n);
}
